Calakmul, meaning "city with two adjacent pyramids", is hidden in the jungle, in the state of Campeche, some 200km inland of Chetumal and very close to another ancient settlement: Tikal in Guatemala. ‚ú®
The site is located in Calakmul Biosphere, home of many endangered species of reptiles and others, such as jaguars and jungle cats.üíö

It has been one of the most important cities in the mayan world, recording around 50000 inhabitants at its highest splendour. Also, one of the most well known dynasty had a seat in the late classic period, the Kaan. üêç

117 stelae representing the Kings and their wives can be found, as well as ceramic and paintings.

If you wish to discover an ancient world, away from the tourist path, then Calakmul won't let you down. You can feel the ancient magic everywhere at this site.üíô

